import "./Card.css";

function Card(props){

    return (
        <div id="teste" className="Card">
            <div className="CardContainer">
                <div className="DivTexto">
                <h2>{props.titulo}</h2>
                <p>{props.subtitulo}</p>
                </div>
                <div className="DivValor">
                    <h3>{props.preco}</h3>
                </div>
            </div>
        </div>
    );

}

export default Card;
